import React from 'react'
import styled from "styled-components"
import AppLadyout from '../components/AppLayout';


const GoodButton = styled.button`
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`

const Home = () => {
  return (
    <AppLadyout>
      <div> Hello, Next!</div>
    </AppLadyout>
  )
};

export default Home;
